import React from 'react';
import './SearchPage.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {
  faMagnifyingGlass,
  faMapLocationDot,
  faPhone,
} from '@fortawesome/free-solid-svg-icons';

const SearchPage = () => {
  return (
    <div className='search_page'>
      <p>HOTPLACE</p>
      <ul>
        <li>지역검색</li>
      </ul>
      <div className='search_box'>
        <input type='search' className='search_input' placeholder='Search...' />
        <a href='#'>
          <FontAwesomeIcon
            icon={faMagnifyingGlass}
            style={{ color: '#111111' }}
          />
        </a>
      </div>
      <div className='hotplace'>
        <div className='number'>
          <img className='img' alt='Vector' src='vector-1.svg' />
          <FontAwesomeIcon icon={faPhone}> 02-717-5509</FontAwesomeIcon>
        </div>
        <div className='location'>
          <div className='text-wrapper'>서울 마포구 고산길 16</div>
          <FontAwesomeIcon icon={faMapLocationDot} />
        </div>
        <div className='name'>
          <div className='text-wrapper'>투다리 서강점</div>
        </div>
      </div>
    </div>
  );
};

export default SearchPage;
